function LoginPage() {
  return (
    <div class="login-page">
      <div class="form">
        <form class="login-form">
          <input type="text" placeholder="username" />
          <input type="password" placeholder="password" />
          <button>login</button>
        </form>
      </div>
    </div>
  );
}

export default LoginPage;
